script: |
  super -f text -I q5414.spq | sort > q5414.out

inputs:
  - name: q5414.spq
    data: |
      SELECT DISTINCT 69 * + cor2.col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5414.out
    data: |
      1173
      2139
      4071
